import React from 'react';
import './style.css';

const Navbar = () => {
  return (
    <nav>
      <div className='logo'><h2>Company name</h2></div>

      <div className='item-cont'>
        <a href="">Home</a>
        <a href="">Services</a>
        <a href="">Contact us</a>
        <a href="">About us</a>
      </div>
    </nav>
  )
}

export default Navbar
